import React, { useState } from "react";

const Index = () => {
  const [text, setText] = useState("");
  const [count, setCount] = useState(0);
  return (
    <>
      <input
        type="text"
        value={text}
        onChange={(e) => {
          setText(e.target.value);
          setCount(count + 1);
        }}
      />
    </>
  );
};
export default Index;
